/** A primitive compiler to return node as is without stringifying. */
export const fromJson = function () {
    this.parser = (node, file) => {
        return file.result || JSON.parse(node);
    };
};
/** A primitive compiler to return node as is without stringifying. */
export const toJson = function () {
    this.compiler = (node) => {
        return node;
    };
};
export const parseTimestamp = (r) => {
    const timeRegexp = /[\[<](\d{4})-(\d{2})-(\d{2}).*[\]>]/;
    const m = r.match(timeRegexp);
    if (m != null) {
        const year = m[1];
        const month = m[2];
        const day = m[3];
        return `${year}-${month}-${day}`;
    }
    return r;
};
